import React, { useContext} from "react";
import { SendemailContexte } from "./contexte/SendemailContext";
import sendEmail from "./sendEmail"



const Button = () => {
  const {objet, name, email, message} = useContext(SendemailContexte);
  console.log(name)
  return (
    <button onClick={() =>
        sendEmail(
          objet,
          name,
          email,
          message
        )}>
          Send
    </button>
  )
}

export default Button
